//SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;


contract Counter {

    address public owner;
    mapping(address => uint256) public balances;
    uint256 public _money;

    constructor(uint256 money){
        owner = payable(msg.sender);
        _money = money;
    }

    //查询
    function getAccount() public view returns (uint) {
        return balances[msg.sender];
    }

    //存储每一个地址的转账金额
    function queryRecord() public view returns(uint256) {
        return balances[owner];
    }

    //存钱
    function saveMoney(uint _accout) external payable returns(bool){
        balances[msg.sender] += _accout;
        return true;
    }

    //取钱
    function withDraw(uint256 _withdraMoney) external payable{
        require(balances[address(this)] >= _withdraMoney,"not enough money" );
        balances[address(this)] -= _withdraMoney;
    }
}

